import { MyListElementContent } from "./MyListElementContent";
import { useSelector } from "react-redux";

export const MyListsElementBox = (data: any) => {
  return (
    <>
      {data.map((item: any, index: number) => (
        <MyListElementContent item={item} index={index} />
      ))}
    </>
  );
};
